for i in range(2, 11):
    mean = stat.mean(array[i])
    std = np.std(array[i], dtype=np.float64)
    binwidth = 0.04
    fig, ax = plt.subplots()
    counts, edges, plot = plt.hist(array[i], bins=np.arange(7, 12 + binwidth, binwidth))
    max_height = max(counts)
    plt.title('Distribution of Radius of Gyration for ' + str(i) + ' Vertex Connections')
    plt.xlabel('Radius of Gyration')
    plt.ylabel('Frequency')

    plt.plot([mean, mean], [0, max_height], color='red')
    plt.plot([mean - std, mean - std], [0, max_height], color='green')
    plt.plot([mean + std, mean + std], [0, max_height], color='green')

    red_line = mlines.Line2D([],[],color='red', label = r'$\mu$' + ' = ' + str(round(mean, 3)))
    ax.legend(handles=[red_line])
    green_line = mlines.Line2D([], [], color='green', label = r'$\sigma$' + ' = ' + str(round(std, 3)))
    ax.legend(handles=[red_line,green_line])

    plt.savefig("Rg for Vc" + str(i).zfill(2) +".jpg", dpi=600)
    plt.show()
